'dg_read_field_def_as.DeviceActivationContext'(
    <<1:1, X:7, Rest/binary>>,
    N,
    Acc,
    F,
    F@_1,
    F@_2,
    TrUserData
) when N < 32 - 7 ->
    'dg_read_field_def_as.DeviceActivationContext'(
        Rest,
        N + 7,
        X bsl N + Acc,
        F,
        F@_1,
        F@_2,
        TrUserData
    );
'dg_read_field_def_as.DeviceActivationContext'(
    <<0:1, X:7, Rest/binary>>,
    N,
    Acc,
    _,
    F@_1,
    F@_2,
    TrUserData
) ->
    Key = X bsl N + Acc,
    case Key of
        10 ->
            'd_field_as.DeviceActivationContext_dev_addr'(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
        18 ->
            'd_field_as.DeviceActivationContext_app_s_key'(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
        _ ->
            case Key band 7 of
                0 ->
                    'skip_varint_as.DeviceActivationContext'(
                        Rest,
                        0,
                        0,
                        Key bsr 3,
                        F@_1,
                        F@_2,
                        TrUserData
                    );
                1 ->
                    'skip_64_as.DeviceActivationContext'(
                        Rest,
                        0,
                        0,
                        Key bsr 3,
                        F@_1,
                        F@_2,
                        TrUserData
                    );
                2 ->
                    'skip_length_delimited_as.DeviceActivationContext'(
                        Rest,
                        0,
                        0,
                        Key bsr 3,
                        F@_1,
                        F@_2,
                        TrUserData
                    );
                3 ->
                    'skip_group_as.DeviceActivationContext'(
                        Rest,
                        0,
                        0,
                        Key bsr 3,
                        F@_1,
                        F@_2,
                        TrUserData
                    );
                5 ->
                    'skip_32_as.DeviceActivationContext'(
                        Rest,
                        0,
                        0,
                        Key bsr 3,
                        F@_1,
                        F@_2,
                        TrUserData
                    )
            end
    end;
'dg_read_field_def_as.DeviceActivationContext'(<<>>, 0, 0, _, F@_1, F@_2, _) ->
    #'as.DeviceActivationContext'{dev_addr = F@_1, app_s_key = F@_2}.

'd_field_as.DeviceActivationContext_dev_addr'(
    <<1:1, X:7, Rest/binary>>,
    N,
    Acc,
    F,
    F@_1,
    F@_2,
    TrUserData
) when N < 57 ->
    'd_field_as.DeviceActivationContext_dev_addr'(
