'd_field_as.DeviceActivationContext_dev_addr'(
    <<0:1, X:7, Rest/binary>>,
    N,
    Acc,
    F,
    _,
    F@_2,
    TrUserData
) ->
    {NewFValue, RestF} = begin
        Len = X bsl N + Acc,
        <<Bytes:Len/binary, Rest2/binary>> = Rest,
        Bytes2 = binary:copy(Bytes),
        {id(Bytes2, TrUserData), Rest2}
    end,
    'dfp_read_field_def_as.DeviceActivationContext'(RestF, 0, 0, F, NewFValue, F@_2, TrUserData).

'd_field_as.DeviceActivationContext_app_s_key'(
