    <<0:1, X:7, Rest/binary>>,
    N,
    Acc,
    F,
    F@_1,
    Prev,
    TrUserData
) ->
    {NewFValue, RestF} = begin
        Len = X bsl N + Acc,
        <<Bs:Len/binary, Rest2/binary>> = Rest,
        {id('decode_msg_common.KeyEnvelope'(Bs, TrUserData), TrUserData), Rest2}
    end,
    'dfp_read_field_def_as.DeviceActivationContext'(
        RestF,
        0,
        0,
        F,
        F@_1,
        if
            Prev == undefined -> NewFValue;
            true -> 'merge_msg_common.KeyEnvelope'(Prev, NewFValue, TrUserData)
        end,
        TrUserData
    ).

