        case Prev of
            undefined ->
                id({lora_modulation_config, NewFValue}, TrUserData);
            {lora_modulation_config, MVPrev} ->
                id(
                    {lora_modulation_config,
                        'merge_msg_gw.LoRaModulationConfig'(MVPrev, NewFValue, TrUserData)},
                    TrUserData
                );
            _ ->
                id({lora_modulation_config, NewFValue}, TrUserData)
        end,
        F@_4,
